import React from 'react';

const DoctorList = () => {
  const doctors = [
    "Dr. Christopher Lee",
    "Dr. Patrick",
    "Dr. Christopher Davis",
    "Dr. Richard James",
    "Dr. Ben Harvey"
  ];

  return (
    <section className="flex flex-col mt-0 max-w-full text-sm font-thin leading-5 text-gray-800 bg-white w-[648px] max-md:mt-0">
      <header className="flex gap-2.5 py-4 w-full rounded border border-solid min-h-[58px] max-md:max-w-full" />
      <ul className="flex flex-col px-px pt-4 pb-px w-full border-r border-b border-l border-solid max-md:max-w-full">
        {doctors.map((doctor, index) => (
          <li key={index} className="flex flex-wrap gap-3 px-6 py-3 w-full max-md:px-5 max-md:max-w-full">
            <div className="flex shrink-0 w-10 h-10 rounded-full bg-zinc-600" aria-hidden="true" />
            <div className="flex-auto my-auto w-[538px] max-md:max-w-full">{doctor}</div>
          </li>
        ))}
      </ul>
    </section>
  );
};

export default DoctorList;
